import React, { useState } from "react";
import reactDom from "react-dom";
import cont from "./assets/bg-content.png";
import Modal from "react-bootstrap/Modal";
import prevButton from "./assets/button-prev.png";
import nextButton from "./assets/button-next.png";

import Button from "react-bootstrap/Button";
import contentImg from "./assets/bg-content.png";

export default function CustomModal(props) {
  const { id, img } = props;
  return (
    <Modal
    id = {id} 
    style = {{ backgroundImage: img }} 
      {...props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header>

        <Modal.Title id="contained-modal-title-vcenter">

        
        </Modal.Title>
      </Modal.Header>

      <Modal.Body>
        <h4></h4>
        
        <p></p>
      </Modal.Body>
      <Modal.Footer>
        <Button>
          {" "}
          <img src={prevButton} id="prev" />{" "}
        </Button>
        <Button>
          {" "}
          <img src={nextButton} id="next" />{" "}
        </Button>
      </Modal.Footer>
    </Modal>
  );
}
